/*
 * Google Web Search - gray logo replacement
 *
 * Author      : Valacar
 * Date        : January 22th, 2007
 * Website     : http://www.valacar.com/userstyles/
 * Description : Replaces the Google Web Search logo with a grayscale version.
 *               IMPORTANT: This is the logo images only!
 * Required    : "Google Web Search - dark gray redesign (vC)" should be installed as well.  You can find it on
 *               http://userstyles.org/style/show/1693 or on my web site (listed above).
 * Usage       : Use with Stylish Firefox extension (http://userstyles.org/) or copy to your Firefox userContent.css file
 */

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url(http://www.google.de/), url-prefix(http://www.google.de/webhp), url-prefix(http://images.google.de/webhp) {

/* Replace main logo image */
body img[src*="/logos/"][width="276"], body img[src$="logo.gif"], body div[style*="logo_plain.png"], body img[src$="logo_google_suggest.gif"] {
	margin-top: 5em !important;
	width: 0 !important;
	height: 103px !important;
	padding-left: 281px !important;
	background-image: url("data:image/png;base64,") !important;
}

}


@-moz-document url-prefix(http://www.google.de/search?), url-prefix(http://www.google.de/advanced_search), url-prefix(http://www.google.de/preferences), url-prefix(http://www.google.de/language_tools) {

/* Replace small upper left logo images */
body #logo span, body img[src*="/logos/"][width="150"], body img[src$="logo_sm.gif"][width="150"], body img[src$="logo_google_suggest_sm.gif"] {
	background: url("data:image/png;base64,") top left no-repeat !important;
}
body img[src*="/logos/"][width="150"], body img[src*="logo_sm.gif"][width="150"], body img[src$="logo_google_suggest_sm.gif"] {
	width: 0 !important;
	height: 50px !important;
	padding-left: 135px !important;
}

}

